import React, {Component, Fragment} from "react";
import {Helmet} from 'react-helmet';


class Quiz extends React.Component{
    constructor(props){
        super(props);

    }

    increamentCounter = ()=>{
        this.setState((prevState, props) => ({
            counter: prevState.counter + 1
        })); 
    }

    render(){
        return(
            <Fragment>
                <Helmet><title>Quiz Page</title></Helmet>
            </Fragment>
        );
    }

}

export default Quiz
